import React, { Component } from 'react';
import image1 from './Images/1.jpg';
import './Card.css';

class Card extends Component {

  render() {
    return (
      <div className="Card">
        <div className="card">
            <img className="card-img-top" src={image1} alt="Card image cap"/>
            <h5 className="card-title">Titanic: Machine Learning from Disaster</h5>
            <div className="card-block">
              <p className="card-text">Artificial neural network that predicts how likely a person is to survive on the titanic based on their background.</p>
            </div>
        </div>

        <div className="modal fade" id="exampleModal" tabIndex="-1" role="dialog" aria-labelledby="exampleModalLabel" aria-hidden="true">
        <div className="modal-dialog" role="document">
          <div className="modal-content">
            Hello world
          </div>
        </div>
      </div>
      </div>

    );
  }
}

export default Card;
